6600},"willBeRetried":false}},{"source":{"uri":"file:///C:/Users/Ertuğrul/IdeaProjects/Members_Panel/src/test/resources/features/Uretici%20ve%20Toptancılar.feature","data":"@regresyon\r\n  @ureticivetoptancı\r\nFeature: Üretici ve Toptancılar\r\n\r\n  @tc06\r\n  Scenario: TC06\r\n\r\n    Given kullanıcı members.rexven.com sayfasına gider\r\n    Then  geçerli mail bir adresi girer\r\n    And  gecerli password girer\r\n    And  uretici ve toptancılar sekmesine tıklar\r\n    Then sayfayı aşagı-yukarı kaydırır tüm saticilari görür\r\n    And iletişim kur butonuna tıklar\r\n    And  telefon numarası girer ve doğrulama kodu geldiğini teyit eder\r\n\r\n\r\n  @tc07\r\n  Scenario: TC07\r\n    Given kullanıcı members.rexven.com sayfasına gider\r\n    Then  gecerli mail adresi girer\r\n    And  gecerli password girer\r\n    And  uretici ve toptancılar sekmesine tıklar\r\n    And urunler butonuna tıklar\r\n    Then sayfayı aşagı kaydırır tüm ürünleri görür\r\n    And  iletişim kur butonuna tıklar ve whatsapp'a yönlendirdiğini teyit eder\r\n   # And sayfayı kapatır.\r\n\r\n\r\n  @tc08\r\n  Scenario: TC08\r\n    Given kullanıcı members.rexven.com sayfasına gider\r\n    Then  gecerli mail adresi girer\r\n    And  gecerli password girer\r\n    And  uretici ve toptancılar sekmesine tıklar \r\n    And search butonuna eşofman yazar\r\n    Then ara sekmesine tıklar\r\n    And Mossi isimli firmanın urunleri incele sekmesine tıklar\r\n    And sayfa URL'sinin Mossi isimli firmaya ait olduğunu teyit eder\r\n    Then sayfayı aşagı kaydırıp tüm ürünleri görür\r\n    And ikinci sayfaya gecer tüm ürünleri kontrol eder\r\n    And ucuncu sayfaya gecer tüm urunleri kontrol eder\r\n   # And sayfayı kapatır.\r\n\r\n    @tc09\r\n    Scenario: TC09\r\n      Given kullanıcı members.rexven.com sayfasına gider\r\n      Then  gecerli mail adresi girer\r\n      And  gecerli password girer\r\n      And  uretici ve toptancılar sekmesine tıklar\r\n      Then Uretici veya Toptancı ol sekmesine tıklar\r\n      And acilan sayfada gerekli bilgileri doldurur\r\n      And kayıt ol sekmesine tıklar\r\n      And  Kullanıcı magaza bilgileri gecersiz. Lütfen kontrol ediniz yazısını görür\r\n     # And sayfayı kapatır.\r\n\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Ertuğrul/IdeaProjects/Members_Panel/src/test/resources/features/Uretici%20ve%20Toptancılar.feature","feature":{"location":{"line":3,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@regresyon","id":"9fff5e1a-15d4-4109-886e-ab2a35f9ceea"},{"location":{"line":2,"column":3},"name":"@ureticivetoptancı","id":"0daab79f-d274-4765-93bc-816dfab953dd"}],"language":"en","keyword":"Feature","name":"Üretici ve Toptancılar","description":"","children":[{"scenario":{"location":{"line":6,"column":3},"tags":[{"location":{"line":5,"column":3},"name":"@tc06","id":"910e025f-66f3-4db9-8e6b-6f8f3ccfee8c"}],"keyword":"Scenario","name":"TC06","description":"","steps":[{"location":{"line":8,"column":5},"keyword":"Given ","keywordType":"Context","text":"kullanıcı members.rexven.com sayfasına gider","id":"42c81c72-a6ea-4e6d-b86c-3d37d53ed160"},{"location":{"line":9,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"geçerli mail bir adresi girer","id":"792d905b-94b6-4cd1-ac96-b8d132e16d40"},{"location":{"line":10,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"gecerli password girer","id":"959ebc34-b80a-4708-8bd5-79557c98d6e3"},{"location":{"line":11,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"uretici ve toptancılar sekmesine tıklar","id":"b2655d7a-0c94-42a7-ab8d-3c0a37b22cea"},{"location":{"line":12,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"sayfayı aşagı-yukarı kaydırır tüm saticilari görür","id":"107587c2-c99b-4c3b-af00-bf381999ddc9"},{"location":{"line":13,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"iletişim kur butonuna tıklar","id":"9acf8d05-0c16-489b-8aa3-8ccd82a6941b"},{"location
